import * as types from '@/constants/User';
import Api from '@/utils/Api';
import Store from '@/reducer';

export const fetchUserRequest = () => {
    Store.dispatch({
        type: types.FETCH_USER_REQUEST,
    });
    Api.getUser()
        .then(res => {
            console.log(res);
            Store.dispatch({
                type: types.FETCH_USER_SUCCESS,
                data: res,
            });
        })
        .catch();
};
